class PostDetailsComponent {
    constructor(postService, route, router) {
        this.postService = postService;
        this.route = route;
        this.router = router;
        this.currentPost = null;
        this.message = '';
    }
    ngOnInit() {
        this.message = '';
        this.getPost(this.route.snapshot.paramMap.get('id'));
    }
    getPost(id) {
        this.postService.get(id)
            .subscribe(data => {
            this.currentPost = data;
            console.log(data);
        }, error => {
            console.log(error);
        });
    }
    updatePublished(status) {
        const data = {
            title: this.currentPost.title,
            description: this.currentPost.description,
            published: status
        };
        this.postService.update(this.currentPost.id, data)
            .subscribe(response => {
            this.currentPost.published = status;
            console.log(response);
        }, error => {
            console.log(error);
        });
    }
    updatePost() {
        this.postService.update(this.currentPost.id, this.currentPost)
            .subscribe(response => {
            console.log(response);
            this.message = 'The Post was updated successfully!';
        }, error => {
            console.log(error);
        });
    }
    deletePost() {
        this.postService.delete(this.currentPost.id)
            .subscribe(response => {
            console.log(response);
            this.router.navigate(['/postes']);
        }, error => {
            console.log(error);
        });
    }
}
